          <Container>
            <Heading text="Video Cards: Default" />
            <Column cols="3">
              {VideoData.slice(0, 3).map(({
              id,
              source,
              title
            }) => <Card key={id} noLink>
                  <Card.Video source={source} />
                  <Card.Header>{title}</Card.Header>
                </Card>)}
            </Column>
          </Container>

          <Container>
            <Heading text="Video Cards: Shadow on Static" />
